import React, { useState, useRef, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from "react-router-dom";
import { Home, Film, Tv, Search, Settings } from "lucide-react";
import { SettingsPage } from "./components/SettingsPage";

function App() {
  const [darkMode, setDarkMode] = useState(true);

  return (
    <Router>
      <div className={darkMode ? "bg-black text-white min-h-screen" : "bg-white text-black min-h-screen"}>
        <aside className="w-64 bg-zinc-900 p-4">
          <h1 className="text-2xl font-bold mb-6">CinemAI</h1>
          <nav className="flex flex-col gap-4">
            <Link to="/" className="flex items-center gap-2 hover:text-red-500"><Home size={20}/> Home</Link>
            <Link to="/movies" className="flex items-center gap-2 hover:text-red-500"><Film size={20}/> Movies</Link>
            <Link to="/tv-shows" className="flex items-center gap-2 hover:text-red-500"><Tv size={20}/> TV Shows</Link>
            <Link to="/search" className="flex items-center gap-2 hover:text-red-500"><Search size={20}/> Search</Link>
            <Link to="/settings" className="flex items-center gap-2 hover:text-red-500"><Settings size={20}/> Setări</Link>
          </nav>
        </aside>

        <main className="p-6">
          <Routes>
            <Route path="/settings" element={<SettingsPage />} />
            <Route path="/" element={<h2>Pagina principală</h2>} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
